        ascension,
      }) {
        aim(index, ascension)
      }

      function listenTo({
        frequency = 1000 // Frequency in MHz
      }) {
        listen(selectedTelescope, ascension)
      }

      return (
        <TelescopeArray>
          <div>
            <button onClick={listenTo}>Listen</button>
            <Telescope ascension={} />
          </div>
